         }}

         onClick={() => console.log("Event Hanlder Called")} />
        })
      }

    return (
        <>
            <Map
                /* google={this.props.google} */
                /* style={customizeMap} */
                zoom={6}
                initialCenter={{ 
                    lat: 9.96233, 
                    lng: 49.80404
                }}>
                {drawMarker()}
            </Map>
        </>
    )
}

